The Rust SDK is "modular" meaning that each AWS service is its own crate. Each crate provides two layers to access the service: The "fluent" API. For most use cases, a high level API that ties together connection management and serialization will be the quickest path to success. #[tokio::main]
async fn main() { let client = dynamodb::Client::from_env(); let tables = client .list_tables() .limit(10) .send() .await.expect("failed to load tables");
